import './App.css';
import Navbar from './components/Navbar/Navbar';
import ItemListContainer from './components/ItemListContainer/ItemListContainer';
import Counter from './components/Counter/Counter';
import ItemDetailContainer from './components/ItemDetailContainer/ItemDetailContainer';
import { useState } from 'react';
import { BrowserRouter, Routes } from 'react-router-dom'

function App() {

  const [page, setPage] = useState({path:'list', id:'1'})

  const handleOnAdd = (quantity)=> {
    console.log('La cantidad de productos seleccionados es', quantity)
  }

  return (
    <div className="App">
      <BrowserRouter>
      <header className="App-header">
        <Navbar/>
        <Routes>
          <ItemListContainer greeting="Bienvenido a mi E-Commerce en desarrollo :)" />
        <Counter stock={11} initial={1} onAdd={handleOnAdd}/>
        </Routes>
        <ItemDetailContainer />
      </header>


      </BrowserRouter>

    </div>

  );
}

export default App;
